import React, { Component } from 'react';
import './App.css';
import {Avatar, Layout, Menu} from "antd";

export default class UserProfile extends Component {


    render() {
        return (
            <div className="UserProfile">
                <Avatar style={{ backgroundColor: '#87d068' }} icon="user" />
            </div>
        );
    }
}
